import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const greetDiv = {
  display: 'flex',
  justifyContent:'center',
  alignItems:'center',
  height: '400px',
  width: '100%'
}

ReactDOM.render(
	<>
		<div style={greetDiv}>
      <h1 className="">Hello Sir, Good Morning</h1> 
    </div>
	</>,
	document.getElementById('root')
);
